                <h2 class="main-title">Felvidék és Kárpátalja</h2>
                <p class="description">
                    A trianoni békeszerződés nyomán Csehszlovákia egész Észak-Magyarországot és Kárpátalját
                    megkapta. Az impériumváltást megelőzően a kassai és pozsonyi állandó együttesen kívül három
                    nagyobb és kisebb, utazó társulat működött a Felvidéken. A magyar színészetet két
                    meghatározó személyiség irányította: Kassán 1914-től Faragó Ödön, Pozsonyban pedig 1911-től
                    Polgár Károly.
                    Szlovákiában a színházépületeket a magyar együttesek rovására osztották el. A korábbi
                    koncessziók érvényüket vesztették, ugyanis 1920-ban magyar nyelvű színielőadások rendezésére
                    Szlovákia egész területén csak egyetlen igazgatónak adtak engedélyt. Ezt pedig Faragó Ödön
                    kapta meg, aki az új történelmi helyzetben – dacolva a támadásokkal – szükségesnek tartotta
                    cseh vagy szlovák darabok magyar nyelvű bemutatását is.
                    A magyar színészet helyzetét tovább súlyosbította az a rendelkezés, mely szerint csak
                    azokban a városokban léphettek fel magyar színészek, ahol – az 1921-es népszámlálási adatok
                    szerint – a magyar lakosság lélekszáma meghaladta a húsz százalékot. A cseh színjátszás
                    fokozatos térnyerésével a két nagy színházi központban, Kassán és Pozsonyban mindinkább
                    visszaszorult Faragó együttese, amely szubvenció híján folyamatosan anyagi nehézségekkel
                    küszködött.
                    Kárpátalja, újabb nevén Ruszinszkó, nem jutott autonómiához a két világháború közötti
                    évtizedekben, ami színházi téren azzal a pozitívummal járt, hogy központilag nem szabták meg
                    az itt fellépő, vagy idelátogató magyar társulatok útvonalait.

                </p>
